      <b>coquillettes</b>, ou <b>cornettes</b> en <a href=\\\"/wiki/Suisse\\\" title=\\\"Suisse\\\">Suisse</a><sup
      id=\\\"cite_ref-1\\\" class=\\\"reference\\\"><a href=\\\"#cite_note-1\\\"><span
      class=\\\"cite_crochet\\\">[</span>1<span class=\\\"cite_crochet\\\">]</span></a></sup>
      et en <a href=\\\"/wiki/Belgique\\\" title=\\\"Belgique\\\">Belgique</a><sup
      id=\\\"cite_ref-2\\\" class=\\\"reference\\\"><a href=\\\"#cite_note-2\\\"><span
      class=\\\"cite_crochet\\\">[</span>2<span class=\\\"cite_crochet\\\">]</span></a></sup>,
      sont une vari\xE9t\xE9 de <a href=\\\"/wiki/P%C3%A2tes_alimentaires\\\" title=\\\"P\xE2tes
      alimentaires\\\">p\xE2tes alimentaires</a> fran\xE7aises pr\xE9par\xE9es avec
      de la <a href=\\\"/wiki/Farine\\\" title=\\\"Farine\\\">farine</a> de <a href=\\\"/wiki/Bl%C3%A9_dur\\\"
      title=\\\"Bl\xE9 dur\\\">bl\xE9 dur</a> et \xE9ventuellement des <a href=\\\"/wiki/%C5%92uf_(aliment)\\\"
      title=\\\"\u0152uf (aliment)\\\">\u0153ufs</a>.\",\"</p><p>Cette forme de p\xE2te
      typiquement <a href=\\\"/wiki/France\\\" title=\\\"France\\\">fran\xE7aise</a>
      a \xE9t\xE9 cr\xE9\xE9e par l'industrie alimentaire au <abbr class=\\\"abbr\\\"
      title=\\\"19\u1D49 si\xE8cle\\\"><span class=\\\"romain\\\">XIX</span><sup style=\\\"font-size:72%\\\">e</sup></abbr>&#160;si\xE8cle<sup
      id=\\\"cite_ref-3\\\" class=\\\"reference\\\"><a href=\\\"#cite_note-3\\\"><span
      class=\\\"cite_crochet\\\">[</span>3<span class=\\\"cite_crochet\\\">]</span></a></sup><sup
      class=\\\"reference cite_virgule\\\">,</sup><sup id=\\\"cite_ref-4\\\" class=\\\"reference\\\"><a
      href=\\\"#cite_note-4\\\"><span class=\\\"cite_crochet\\\">[</span>4<span class=\\\"cite_crochet\\\">]</span></a></sup>.\\n</p><p>Bien
      que l\u2019appellation \xAB&#160;cornettes&#160;\xBB soit recommand\xE9e au
      Qu\xE9bec par l'<a href=\\\"/wiki/Office_qu%C3%A9b%C3%A9cois_de_la_langue_fran%C3%A7aise\\\"
      title=\\\"Office qu\xE9b\xE9cois de la langue fran\xE7aise\\\">Office qu\xE9b\xE9cois
      de la langue fran\xE7aise</a><sup id=\\\"cite_ref-5\\\" class=\\\"reference\\\"><a
      href=\\\"#cite_note-5\\\"><span class=\\\"cite_crochet\\\">[</span>5<span class=\\\"cite_crochet\\\">]</span></a></sup>,
      on les y appelle tout simplement \xAB&#160;macaronis&#160;\xBB, sous l'influence
      du <i><a href=\\\"/wiki/Macaroni_au_fromage\\\" title=\\\"Macaroni au fromage\\\">mac
      &amp; cheese</a></i> nord-am\xE9ricain.\\n</p><p>Le mot est d\xE9riv\xE9 de
      \xAB&#160;coquille&#160;\xBB<sup id=\\\"cite_ref-6\\\" class=\\\"reference\\\"><a
      href=\\\"#cite_note-6\\\"><span class=\\\"cite_crochet\\\">[</span>6<span class=\\\"cite_crochet\\\">]</span></a></sup>,
      en raison de sa forme en tube coud\xE9.\\n</p>\\n<div class=\\\"clear\\\" style=\\\"clear:left;\\\"></div>\",\"<div
